import React, { Component } from 'react';
import {Jumbotron, Button, Container, Row} from 'react-bootstrap';

import '../css/bootstrap.css';

class Home extends Component{
  render(){
    return <Container>
      <Row>
      <div className=" col-lg-4 col-md-4 col-sm-4 col-xs-6 filter hdpe">
          <img src="http://fakeimg.pl/365x365/" className="img-responsive" />
      </div>
      </Row>
    </Container>
  }
}

export default Home;
